import React from 'react';

function Square({ value, onClick, isWinningSquare }) {
    const style = isWinningSquare ? { background: 'yellow' } : null;

    return (
        <button className="square" onClick={onClick} style={style}>
            {value}
        </button>
    );
}

export default Square;
